// src/components/Navbar.js
import './Navbar.css';

function Navbar() {
  return (
    <div className="navbar-container">
      {/* Logo block */}
      <div className="logo-block">
        <div className="logo">
          <span style={{ color: 'teal' }}>K</span>
           <span style={{ color: 'orange' }}>r</span>
            <span style={{ color: 'yellow' }}>u</span>
             <span style={{ color: 'lavender' }}>t</span>
              <span style={{ color: 'black' }}>s</span>
               <span style={{ color: '#' }}>h</span>
                <span style={{ color: '#3AB982' }}>a</span>
         
        </div>
      </div>

      {/* Lines */}
      <div className="top-line" />
      <div className="left-line" />
      <div className="right-line" />

      {/* Nav Links */}
     <div className="nav-links">
  <a href="#hero">Home</a>
  <a href="#about">About</a>
  <a href="#services">Services</a>
  <a href="#faq">Contact</a>
    <a href="#start" className="start-now-btn not-hover-link">
    Start now <span className="arrow">â†—</span>
  </a>
</div>
    </div>
  );
}

export default Navbar;
